	function __construct() {
		// get array: chinese encode with asci
		$str_arr = explode(',', $this->_str_ch_asci);
		$str_arr_tmp = array();

		foreach ($str_arr as $val) {
			$tmp = explode(':', $val);
			$str_arr_tmp[$tmp[1]] = $tmp[0];
		}
		$this->_arr_ch_asci = $str_arr_tmp;

		// get array: chinese encode with chinese string
		$str_arr = explode(',', $this->_str_ch);
		$str_arr_tmp = array();

		foreach ($str_arr as $val) {
			$tmp = explode(':', $val);
			$str_arr_tmp[$tmp[1]] = $tmp[0];
		}
		$this->_arr_ch = $str_arr_tmp;

		// get array: asci encode with asci string
		$str_arr = explode(',', $this->_str_asci);
		$str_arr_tmp = array();

		foreach ($str_arr as $val) {
			$tmp = explode(':', $val);
			$str_arr_tmp[$tmp[0]] = $tmp[1];
		}
		$this->_arr_asci = $str_arr_tmp;


	}

	function asci2chinese($string) {
		$encoding = mb_detect_encoding($string, 'auto');
		$str_len = mb_strlen($string, $encoding);
		$char_cnt = 0;

		while ($char_cnt < $str_len) {
			$char = mb_substr($string, $char_cnt, 1, $encoding);

			if (ord($char) > 127) {
				$char_seg2 = mb_substr($string, $char_cnt+1, 1, $encoding);
				$char_seg3 = mb_substr($string, $char_cnt+2, 1, $encoding);
				if (ord($char_seg2) < 128 && ord($char_seg3) < 128) {	// if the second char and third char < 128, not to get chinese, it is not chinese encode
					if ($char_seg2 == '?' || $char_seg3 == '?') {
						if ($char_seg2 == '?') {
							$char_seg2 = '';
						}
						if ($char_seg3 == '?') {
							$char_seg3 = '';
						}
						
						$tmp = $char.$char_seg2.$char_seg3;
					} else {
						$string_ret .= $char;
						$char_cnt++;
						continue;
					}
					
				} elseif ($char_seg2 == '?' || $char_seg3 == '?') {
					if ($char_seg2 == '?') {
						$char_seg2 = '';
					}
					if ($char_seg3 == '?') {
						$char_seg3 = '';
					}
					$tmp = $char.$char_seg2.$char_seg3;
				} else {
					$tmp = mb_substr($string, $char_cnt, 3, $encoding);
				}
				
				$find_id = false;
				foreach ($this->_arr_ch_asci as $key=>$val) {
					if ($val == $tmp) {
						$find_id = $key;
						break;
					}
				}

				if ($find_id != false) {
					foreach ($this->_arr_ch as $key=>$val) {
						if ($key == $find_id) {
							$string_ret .= $val;
							break;
						}
					}
				} else {
					$string_ret .= $char;
					$char_cnt++;
					continue;
				}

				$char_cnt += 3;
			} else {
				$string_ret .= $char;
				$char_cnt++;
			}
		}

		return $string_ret;
	}

	function getChineseCode($c) {
		$res='';
		$len = strlen($c);
		$a = 0;
		while($a < $len){
			$ud = 0;
			if (ord($c{$a}) >=0 && ord($c{$a})<=191){
				//			if (ord($c{$a}) >=0 && ord($c{$a})<=127){
				$ud = ord($c{$a});//echo '--1--';
				$a += 1;
				/*}else if (ord($c{$a}) >=128 && ord($c{$a})<=191){
				$ud = ord($c{$a} - 128);echo '--1--';
				$a += 1;*/
			}else if (ord($c{$a}) >=192 && ord($c{$a})<=223){
				$ud = (ord($c{$a})-192)*64 + (ord($c{$a+1})-128);//echo '--2--';
				$a += 2;
			}else if (ord($c{$a}) >=224 && ord($c{$a})<=239){
				$ud = (ord($c{$a})-224)*4096 + (ord($c{$a+1})-128)*64 + (ord($c{$a+2})-128);//echo '--3--';
				$a += 3;
			}else if (ord($c{$a}) >=240 && ord($c{$a})<=247){
				$ud = (ord($c{$a})-240)*262144 + (ord($c{$a+1})-128)*4096 + (ord($c{$a+2})-128)*64 + (ord($c{$a+3})-128);//echo '--4--';
				$a += 4;
			}else if (ord($c{$a}) >=248 && ord($c{$a})<=251){
				$ud = (ord($c{$a})-248)*16777216 + (ord($c{$a+1})-128)*262144 + (ord($c{$a+2})-128)*4096 + (ord($c{$a+3})-128)*64 + (ord($c{$a+4})-128);//echo '--5--';
				$a += 5;
			}else if (ord($c{$a}) >=252 && ord($c{$a})<=253){
				$ud = (ord($c{$a})-252)*1073741824 + (ord($c{$a+1})-128)*16777216 + (ord($c{$a+2})-128)*262144 + (ord($c{$a+3})-128)*4096 + (ord($c{$a+4})-128)*64 + (ord($c{$a+5})-128);//echo '--6--';
				$a += 6;
			}else if (ord($c{$a}) >=254 && ord($c{$a})<=255){
				$ud = false;//echo '--7--';
			}
			$res .= "$ud";
		}
		
		return $res;
	}
	
	function getChineseEncodyByAsci($ac1, $ac2, $ac3) {
		$ud = (ord($ac1)-224)*4096 + (ord($ac2)-128)*64 + (ord($ac3)-128);
		
		return $ud;
	}
